import "../style/sidebar.css";

import React from 'react';
import {Link} from 'react-router-dom';

import Container from 'react-bootstrap/Container';
import ReactNavBar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

const Navbar = () => (
    <>
        <div class = "side-nav">
            <Container id = "nav" className = "p-4" fluid = {false}>
                <ReactNavBar expand="md" >
                    <ReactNavBar.Toggle className="border-0" aria-controls="navbar-toggle"/>
                    <ReactNavBar.Collapse id="navbar-toggle">
                    <Nav className="ml-auto">
                        <Link className="nav-link nav-custom" to="/engineering">Engineering</Link>
                        <Link className="nav-link nav-custom" to="/design">Design</Link>
                    </Nav>
                    </ReactNavBar.Collapse>
                </ReactNavBar>
            </Container>
        </div>
    </>
);

export default Navbar;
